import React from 'react';
import '../../assets/style/global.css';
import './style.css';
import cine from '../../assets/imagens/cinema.png';
import mascara from '../../assets/imagens/theater.png';
import Footer from '../../components/Footer/Index';
import Header from '../../components/Header/Index';

function Home() {
  return (
    <div>
      <Header/>
        <div className="centerhome">
          <h1>Ŧєʟɪᴘє ʂᴜɢɪʂᴀᴡᴀ®</h1>


          <h2>ś͇͉̖͉̌̔̈̊̅͑̐̅̈́̃͗y͖̙̘͚͈͙͕͉̭̭̍̌̔͛̈́̑̔̽̾͌ͅͅs͔͖͍̪̬̟̠̮̫̳̋̑̂͗ͅț̣̩͓̮̰̄͗̃͌̽̆̾̔̀̾͆̈ẹ̬͈̥͔͍͒͗͋̔̑̋͂̉͌́̎m̠̰̤̗͐̊͊̋̍̋͐́ d̦̖̣̫̖̦̱͎̓̎̂͊̉̒̓̊ͅe̦͍̱̱͍͔̔̎̉͂̏̀v̮̦͎͕͕̭͔̄̿̇̈̋̉̌́́́̀e̬͔͓̦̝̘̣̳̪̱͑͐́̋ͅͅl͈̫̜͔͇͙̟̠͙̤͔̓̓̅͛́͌ò̗̗͚̲͈̈̈́̈̑͂̚p̳̳̪̬̭̜͓̭̏͋͑͗̑̊́͌̽͗̿e͕͍̝̝͂̽̂͗̓́̄̋̊̓͐ř̥̖̤͖̣̥̗̭͓̖̲͛͛͊̅̍̉͛͊̑ͅ </h2>
        </div>
      <Footer/>
    </div>
  );
}

export default Home;
